import { useState } from "react";
import HomePage from "./HomePage";
import ResultsPage from "./ResultsPage";

function App() {
  const [homePage, setHomePage] = useState(true);
  const googleSearch = () => setHomePage(false);

  return (
    <div className="App">
      {homePage ? (
        <HomePage searchButton={googleSearch} homePage={homePage} />
      ) : (
        <ResultsPage homePage={homePage} />
      )}
    </div>
  );
}
export default App;
